import re

# Regular expression to match search engine URLs
search_engine_regex = re.compile(r'https?://(www\.)?(google|bing|yahoo)\.com')

class KeywordScraper:
    def __init__(self):
        self.keywords = {}

    def add_keywords(self, url, keywords):
        self.keywords[url] = keywords

    def get_keywords(self, url):
        if search_engine_regex.match(url):
            return self.keywords.get(url, [])
        else:
            return None

scraper = KeywordScraper()
scraper.add_keywords('https://www.google.com', ['google', 'ads', 'search'])
scraper.add_keywords('https://www.bing.com', ['bing', 'microsoft'])
