import os
from hashlib import md5
import time

def create_snapshot(file_path):
    with open(file_path, 'rb') as f:
        content = f.read()
    snapshot_filename = os.path.basename(file_path) + '.md5'
    snapshot_path = os.path.join(os.path.dirname(file_path), snapshot_filename)
    with open(snapshot_path, 'w') as sf:
        sf.write(md5(content).hexdigest())

def get_files(directory):
    for dirpath, _, filenames in os.walk(directory):
        for filename in filenames:
            yield os.path.join(dirpath, filename)

def detect_changes(directory):
    snapshots = {}
    while True:
        for file_path in get_files(directory):
            create_snapshot(file_path)
            snapshot_filename = os.path.basename(file_path) + '.md5'
            snapshot_path = os.path.join(os.path.dirname(file_path), snapshot_filename)
            with open(snapshot_path, 'r') as sf:
                current_hash = sf.read()

            if file_path in snapshots:
                if snapshots[file_path] != current_hash:
                    print(f"Change detected in: {file_path}")
            snapshots[file_path] = current_hash
        time.sleep(10)  # Check for changes every 10 seconds

detect_changes('/var/www/html')
