from django.conf.urls import url
from django.http import HttpResponse
import yaml

def receive_callback(request):
    yaml_string = request.body.decode('utf-8')  # Decode the request body
    try:
        data = yaml.safe_load(yaml_string)  # Parse the YAML string safely
        # Process the data (e.g., log it, store it, etc.)
        print(data)  # Example action: print the data to the console
    except yaml.YAMLError as e:
        return HttpResponse(f'Error parsing YAML: {str(e)}', status=400)

    return HttpResponse('Success')

urlpatterns = [
    url(r'^receive_callback/$', receive_callback),
]
