from flask import Flask, request, send_from_directory
import tarfile
import os

app = Flask(__name__)

UPLOAD_DIR = 'user_archives'

@app.route('/upload', methods=['POST'])
def upload():
    uploaded_file = request.files['file']

    uploaded_file.save(os.path.join(UPLOAD_DIR, uploaded_file.filename))

    with tarfile.open(os.path.join(UPLOAD_DIR, uploaded_file.filename)) as tar:
        tar.extractall(path=UPLOAD_DIR)  # Extract contents to the upload directory

    os.remove(os.path.join(UPLOAD_DIR, uploaded_file.filename))  # Remove the archive after extraction

    return 'OK'

@app.route('/files/<path:path>')
def get_file(path):
    return send_from_directory(UPLOAD_DIR, path)

if __name__ == '__main__':
    app.run()
```

